package local.algorithm.leetcode;

import com.google.common.collect.Lists;
import org.testng.annotations.Test;

import static org.testng.Assert.*;

/**
 * @author humanbeingxx@sina.com
 * @date 2020/1/1 21:11
 */
public class SubsequenceInLongStringTest {

    @Test
    public void testFind() {
        int result = new SubsequenceInLongString().findFirstThanMin(Lists.newArrayList(1, 3, 5), 4);
        assertEquals(result, 5);

        result = new SubsequenceInLongString().findFirstThanMin(Lists.newArrayList(1, 3, 5), 3);
        assertEquals(result, 5);

        result = new SubsequenceInLongString().findFirstThanMin(Lists.newArrayList(1, 3, 5), 6);
        assertEquals(result, -1);

        result = new SubsequenceInLongString().findFirstThanMin(Lists.newArrayList(1, 3, 5), -1);
        assertEquals(result, 1);
    }

    @Test
    public void testIsSubsequence() {
        boolean result = new SubsequenceInLongString().isSubsequence("abc", "ahbgdc");
        assertTrue(result);

        result = new SubsequenceInLongString().isSubsequence("axc", "ahbgdc");
        assertFalse(result);

        result = new SubsequenceInLongString().isSubsequence("acb", "ahbgdc");
        assertFalse(result);

        result = new SubsequenceInLongString().isSubsequence("leeeeetcode", "");
        assertFalse(result);
    }
}